import React, {Component} from 'react'

export default class LoginStatus extends Component {
    constructor (props) {
        super(props)
    }

    render () {
        return (
            <div className="login-status">
                <p>ユーザーとログイン状況</p>
                <style jsx>{`
                .login-status {
                    width: 280px;
                    color: red;
                }
                `}</style>
            </div>
        )
    }
}
